import React, { useEffect } from 'react'
import { fetchSingleCharacters } from '../Callapi/Helper';
import { useParams } from "react-router-dom";

const Userdetail = () => {
    const usersing = useParams();
    console.log("usersing", usersing.id);
    const userSingleCharacter = async () => {
        let myData = await fetchSingleCharacters();
        console.log("myDatasingle", myData)
        // setAllcharacter(myData.results);
      };

      useEffect(() => {
        userSingleCharacter();
      }, [])

    return (
        <div>

            <div className="card">
                <div className="card-header">
                    Featured
                </div>
                <div className="card-body">
                    <h5 className="card-title">Special title treatment</h5>
                    <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                    <a href="#" className="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    )
}

export default Userdetail
